import React, { Component } from 'react'

export default class CpManage extends Component{


    render(){

        const dataSource=[{
            id:1,
            merchantNo:'123',
            merchantName: '胡彦斌',
            merchantPwd:'123'
          }, {
            id: 2,
            merchantNo:'123',
            merchantName: '胡彦斌',
            merchantPwd:'123'
        }, {
            id: 3,
            merchantNo:'123',
            merchantName: '胡彦斌',
            merchantPwd:'123'
        }
    ]

    const columns = [{
        title: 'Id',
        dataIndex: 'id',
        key: 'id',
      }, {
        title: '商户号',
        dataIndex: 'age',
        key: 'age',
      }, {
        title: '住址',
        dataIndex: 'address',
        key: 'address',
      }];

        return(
            <Table dataSource={dataSource} columns={columns} />
        );
    }
}
